--
-- Table structure for table `products`
--

DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `products` (
  `id` varchar(15) NOT NULL,
  `name_en` varchar(200) DEFAULT NULL,
  `name_zh` varchar(45) DEFAULT NULL,
  `description_en` varchar(512) DEFAULT NULL COMMENT 'Description in English',
  `description_zh` varchar(512) DEFAULT NULL COMMENT 'Description in Chinese',
  `front_img` varchar(45) DEFAULT NULL COMMENT 'front image - F',
  `back_img` varchar(45) DEFAULT NULL COMMENT 'back image - B',
  `detail_1_img` varchar(45) DEFAULT NULL COMMENT 'detail image 1 - D1',
  `detail_2_img` varchar(45) DEFAULT NULL COMMENT 'detail image 2 - D2',
  `priority` int(5) DEFAULT '1' COMMENT 'Display priority, the smaller ones come first',
  `cost` decimal(10,2) DEFAULT NULL,
  `price` decimal(10,0) DEFAULT NULL,
  `discount` decimal(10,0) DEFAULT NULL COMMENT 'The price after discount',
  `components` varchar(180) DEFAULT '[]' COMMENT 'Containing a JSON, indicating the component list and the corresponding percentage',
  `status` char(1) DEFAULT NULL COMMENT 'Indicating the product status: { A: available, S: on sales, F: off shelf, D: deleted, N: N.A. }',
  `created_time` datetime DEFAULT NULL,
  `created_user` int(10) unsigned DEFAULT NULL,
  `modified_time` datetime DEFAULT NULL,
  `modified_user` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_product_creater` (`created_user`),
  KEY `fk_product_modifier` (`modified_user`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

